# strings: "abc", "abcc", "aabbcc" "aabbcca" are valid.
# strings "abccc", "aabbbccc", "acdedc" are not valid.
# or in general if string as is or -1 char makes all chars to have the same frequence the string is valid


def frequence(s):
    d = dict()
    for letter in s:
        if letter in d:
            d[letter] = d.get(letter) + 1
        else:
            d[letter] = 1
    return d


def is_valid(s):
    val = list(frequence(s).values())
    if max(val) == min(val):
        return "YES"
    val_max = val
    val_min = val
    val_max.sort(reverse=True)
    val_max[0] = val_max[0] - 1
    if val_max[0] == 0:
        del val_max[0]
    val_min.sort()
    val_min[0] = val_min[0] - 1
    if val_min[0] == 0:
        del val_min[0]

    if max(val_max) == min(val_max):
        return "YES"
    if max(val_min) == min(val_min):
        return "YES"
    return "NO"


if __name__ == '__main__':
    str_v = ""
    print(is_valid(str_v))
